[{'content': 'how to create smoothly transition scrollable in react-three', 'role': 'user'}
 {'content': 'Here are some tips for creating a smoothly scrollable scene in react-three:

1. Use OrthographicCamera - This camera is better suited for 2D scrolling scenes. PerspectiveCamera can cause distortion which doesn't look as good when scrolling.

2. Limit the number of objects - Having too many objects in the scene can impact performance and cause stuttering when scrolling. Only add objects that are currently visible in the camera's viewport.

3. Use Layers - Group objects into layers and disable layers that are not currently visible. This reduces overdraw and improves performance.

4. Use FramebufferTexture - Render parts of the scene to a texture instead of the full render target. Then you can scroll the texture instead of re-rendering the entire scene.

5. Use InstancedMesh - If you have many repeated objects, use InstancedMesh to reduce draw calls.

6. Add fog - Adding fog can improve the illusion of a large scrolling scene. The fog hides the end of the scene so you can't see when objects are culled. 

7. Use Tween for smooth scrolling - Use a tweening library like react-spring to smoothly scroll the camera position. Abrupt changes in position can seem janky.

Here's an example:
```jsx
import { Canvas } from 'react-three';
import { OrthographicCamera, Layers, InstancedMesh } from 'react-three';
import { a, useSpring } from 'react-spring/three';

function ScrollScene() {
  const cameraPosition = useSpring({ x: 0, y: 0 }, { x: 800, y: 600 });  

  return (
    <Canvas camera={<OrthographicCamera position={[cameraPosition.x, cameraPosition.y, 10]} zoom={30} />}>
      <ambientLight intensity={0.5} />
      <spotLight position={[10, 10, 10]} angle={0.15} penumbra={1} />
      <Layers>
        <Layer name="layer1">
          {/* Render part of scene to texture */}
          <FramebufferTexture attach="layer1-texture" args={[1024, 1024]}> 
            <mesh>
              <InstancedMesh>...</InstancedMesh>  
              {/* Many repeated objects */}
            </mesh>
          </FramebufferTexture>
