    public function store(Request $request)
    {
        $request->validate([
            'file' =>'required|file|max:2048|unique:file',
        ]);

        $file = $request->file('file');

        // Create a new directory if it doesn't exist
        if (!Storage::directory('uploads')) {
            Storage::create('uploads');
        }

