 {'content': 'Voici un exemple de programme en C# qui crée un serveur HTTP à l'aide de la classe `HttpListener` et répond à une demande en affichant "Hello" sur la page.
```
using System;
using System.IO;
using System.Net;
using System.Net.Http;
using System.Text;
using System.Threading.Tasks;

namespace HttpServer
{
    class Program
    {
        static void Main(string[] args)
        {
            HttpListener listener = new HttpListener();
            listener.Prefixes.Add("<http://localhost:8080/>");
            listener.Start();

            Console.WriteLine("Server started on port 8080");

            while (true)
            {
                HttpListenerContext context = listener.GetContext();

                if (context.Request.HttpMethod == "GET")
                {
                    byte[] responseBytes = Encoding.UTF8.GetBytes("Hello");
                    context.Response.StatusCode = 200;
                    context.Response.ContentType = "text/plain";
                    context.Response.ContentLength64 = responseBytes.Length;

                    using (var responseStream = context.Response.OutputStream)
                    {
                        responseStream.Write(responseBytes, 0, responseBytes.Length);
                    }
                }

                context.Response.Close();
            }
        }
    }
}
```
Vous pouvez compiler et exécuter ce programme en tapant les commandes suivantes dans la ligne de commande :
```
csc /target:exe HttpServer.cs
HttpServer.exe
```
